def _iter_all_questions() -> Iterable[Dict[str, Any]]:
    for section in INTAKE_QUESTION_SECTIONS:
        for question in section["questions"]:
            merged = dict(question)
            merged["section_id"] = section["id"]
            merged["section_title"] = section["title"]
            merged.setdefault("score", DEFAULT_SCORE)
            merged.setdefault("success_message", "Anamnez sorusu kaydedildi.")
            yield merged


INTAKE_ACTION_MAP: Dict[str, Dict[str, Any]] = {
    q["action_key"]: q for q in _iter_all_questions()
}

INTAKE_ACTION_KEYS: List[str] = list(INTAKE_ACTION_MAP.keys())
TOTAL_INTAKE_QUESTIONS = len(INTAKE_ACTION_KEYS)


def build_intake_prompt_guidance() -> str:
    lines: List[str] = []
    for section in INTAKE_QUESTION_SECTIONS:
        lines.append(f"[{section['title']}] {section['description']}")
        for question in section["questions"]:
            lines.append(f"  - {question['action_key']}: {question['question']}")
    return "\n".join(lines)


INTAKE_PROMPT_GUIDANCE = build_intake_prompt_guidance()


def get_intake_progress(state: Optional[Dict[str, Any]]) -> Dict[str, Dict[str, Any]]:
    """Helper for safely reading intake progress from scenario state."""
    if not state:
        return {}
    value = state.get("intake_responses")
    return value if isinstance(value, dict) else {}


